KLASİK GİTAR TEL SETİ 3/4 (JUNIOR)
&nbsp;
D'Addario's EJ27N Classic Nylon gitar telleri yeni başlayanlar, öğrenciler ve profesyoneller için aynı derecede uygundur.
&nbsp;
Bu 3/4 Ölçek normal tansiyon tel takımında alt üç tel Dupond şeffaf naylon tiz (treble) tel ile bakır sarım gümüş kaplı üst üç bas telden oluşmaktadır. Bu şekilde tonun sürekliliğinin ve sıcaklığının yansıtılmasının optimum şekilde dengelenmesi sağlamaktadır. Bu normal tansiyon klasik gitar tel takımı aynı zamanda 4/4 ve 1/2 ebadında klasik gitarlar için de temin edilebilmektedir.
&nbsp;
Her tel profesyonel tel setlerine uygulanan yüksek kalite standartlarına tabii tutulmuştur. Bu manada pahalı olmayan fakat güvenilir bir tel takımı arayan bütün gitaristlerin kullanımına uygundur.
&nbsp;D'Addario'nun giriş seviyesi klasik tel seti EJ27N, ses tonu sıcaklık ve projeksiyonunun optimal balansı ile tanınmıştır.Normal tansiyon, şeffaf Dupond Nylon, topuzsuz tel uçuMükemmel balans değeri ve güvenilirlikÇevre dostu, korozyona dayanıklı ambalajı ile daima yepyeni muhafaza edilen teller.En yüksek kalite ve performansı sağlamak üzere ABD'de üretimiştir.
